import React, { Component } from "react";

class FunkoCard extends Component {
  state = {
    clicked: false
  };

  render() {
    const {
      name,
      fandom,
      image_url,
      release_date,
      category
    } = this.props.funko;
    return (
      <div className="funko-card">
        <img className="funko-img" src={image_url} alt={name} />
      </div>
    );
  }
}

export default FunkoCard;
